CREATE TABLE `countries` (
  `Country` varchar(255) NOT NULL,
  `Region` varchar(255) NOT NULL,
  `Population` int(11) DEFAULT NULL,
  `Area` int(11) DEFAULT NULL COMMENT 'sq. mile',
  `Population_Density` double DEFAULT NULL COMMENT 'per sq. mile',
  `Coastline` double DEFAULT NULL COMMENT 'coast/area ratio',
  `Net_Migration` double DEFAULT NULL,
  `Infant_Mortality` double DEFAULT NULL COMMENT 'per 1000 births',
  `GDP` int(11) DEFAULT NULL COMMENT '$ per capita',
  `Literacy` double DEFAULT NULL COMMENT '%',
  `Phones` double DEFAULT NULL COMMENT 'per 1000',
  `Arable` double DEFAULT NULL COMMENT '%',
  `Crops` double DEFAULT NULL COMMENT '%',
  `Other` double DEFAULT NULL COMMENT '%',
  `Climate` double DEFAULT NULL,
  `Birthrate` double DEFAULT NULL,
  `Deathrate` double DEFAULT NULL,
  `Agriculture` double DEFAULT NULL,
  `Industry` double DEFAULT NULL,
  `Service` double DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


CREATE TABLE `happiness_index_15` (
  `Rank` int(3) NOT NULL,
  `Country` varchar(50) NOT NULL COMMENT 'or region',
  `Score` double NOT NULL,
  `Support` double NOT NULL COMMENT 'social',
  `Freedom` double NOT NULL COMMENT 'to make life choices',
  `Generosity` double NOT NULL,
  `Corruption` double NOT NULL COMMENT 'perceptions'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


CREATE TABLE `suicide_rates_15` (
  `Country` varchar(50) DEFAULT NULL,
  `Year` int(11) DEFAULT NULL,
  `Sex` varchar(8) DEFAULT NULL,
  `Age` int(11) DEFAULT NULL,
  `Suicide_no` int(11) DEFAULT NULL,
  `Population_PerYear` int(11) DEFAULT NULL,
  `Suicide_rate` double DEFAULT NULL COMMENT 'per 100000 inhabitants',
  `Country_year` varchar(100) DEFAULT NULL,
  `HDI_year` double DEFAULT NULL,
  `GDP_year` varchar(15) DEFAULT NULL,
  `GDP_capita` int(11) DEFAULT NULL,
  `Generation` varchar(100) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;



ALTER TABLE `countries`
  ADD PRIMARY KEY (`Country`);

ALTER TABLE `happiness_index_15`
  ADD PRIMARY KEY (`Country`);
COMMIT;
